package com.hcl.ebox;

public class MultiDimenArr {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int arr[][]={{12,17},{4,5}};
		for(int row=0;row<2;row++)
		{
			for(int col=0;col<2;col++)
			{
				System.out.print(arr[row][col]+" "+ " ");
				
			}
			System.out.println(" ");
		}

	}

}
